1992-12-06 - Care and Protection (Video:H264 720x544, 997kbps, 25fps - Audio:AAC 44.1kHz, 115kbps)

Nursing his terminally-ill wife, Detective Inspector 'Jack' Frost's life becomes more stressed when, during a missing-child investigation, he unearths evidence on a 30-year-old case involving a skeleton chained to a locked strongbox that turns out to be empty.


1992-12-13 - Not with Kindness (Video:H264 720x544, 996kbps, 25fps - Audio:AAC 44.1kHz, 112kbps)

Frost investigates the murder of a teenage girl, and the case of a woman who has been receiving threatening phone calls. Meanwhile, at the Denton police station, there are threats, deaths, arson and a staff shortage.


